  "description": "Henning Olof Axel Hahne was a Swedish pastor. He was born on January 11th, 1905 in Ishi, Shansi, North China to missionary Axel H. Hahne and Anna Helena Watz. He was married twice and had four children. He completed his school-leaving certificate in Stockholm 1924, theology degree in 1927, theology candidate in 1928, and was ordained for the Lund diocese in 1929. He served in various churches across Sweden before becoming a pastor in Jämshögsby in 1942. He also served as a chairman of Jämshögs parish council and elementary school board."
